import styled from '@emotion/styled';
import { Box, Typography } from '@mui/material'
import React from 'react'

const Component =styled(Box)`
background: #f8f9fa;
padding: 30px 0;
text-align: center;
height: 100%;
`

const Container = styled(Box)`
padding: 0 200px;

`   
const Image = styled('img')({
    width:400,
    height:100
})

export const EmptyChat = () => {
    const imgurl='https://tse4.mm.bing.net/th?id=OIP.vizzy5Ousc1mov_P-r1WpwHaHa&pid=Api&P=0&h=180';

  return (
    <Component>
        <Container>
            <Image src={imgurl}/>
            <Typography>Chatify Online</Typography>
            <Typography>Send and Receive messages from your friends</Typography>
            <Typography></Typography>
        </Container>
    </Component>
  )
}
